import React from 'react'
import { Skeleton, Stack } from "@chakra-ui/react";
const Loader = () => {
  return (
    <Stack>
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
      <Skeleton height="60px" />
    </Stack>
  )
}
export default Loader;
